import React from "react";
import { useDispatch } from "react-redux";
import {
  classHandler,
  dateHandler,
  fromHandler,
  guestsHandler,
  toHandler,
} from "../redux/booking/actions";

const InputData = () => {
  const dispatch = useDispatch();

  const fromSelector = (val) => {
    dispatch(fromHandler(val));
  };

  const toSelector = (val) => {
    dispatch(toHandler(val));
  };

  const dateSelector = (val) => {
    dispatch(dateHandler(val));
  };

  const guestsSelector = (val) => {
    dispatch(guestsHandler(val));
  };

  const classSelector = (val) => {
    dispatch(classHandler(val));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
  };

  return (
    <div class="mt-[160px] mx-4 md:mt-[160px] relative">
      <div class="bg-white rounded-md max-w-6xl w-full mx-auto">
        <form class="first-hero lws-inputform" onSubmit={handleSubmit}>
          {/* <!-- From --> */}
          <div class="des-from">
            <p>Destination From</p>
            <div class="flex flex-row">
              <img src="./img/icons/Frame.svg" alt="" />
              <select
                class="outline-none px-2 py-2 w-full"
                name="from"
                id="lws-from"
                required
                onChange={(e) => fromSelector(e.target.value)}
              >
                <option value="" hidden>
                  Please Select
                </option>
                <option>Dhaka</option>
                <option>Sylhet</option>
                <option>Saidpur</option>
                <option>Cox's Bazar</option>
              </select>
            </div>
          </div>

          {/* <!-- To --> */}
          <div class="des-from">
            <p>Destination To</p>
            <div class="flex flex-row">
              <img src="./img/icons/Frame.svg" alt="" />
              <select
                class="outline-none px-2 py-2 w-full"
                name="to"
                id="lws-to"
                required
                onChange={(e) => toSelector(e.target.value)}
              >
                <option value="" hidden>
                  Please Select
                </option>
                <option>Dhaka</option>
                <option>Sylhet</option>
                <option>Saidpur</option>
                <option>Cox's Bazar</option>
              </select>
            </div>
          </div>

          {/* <!-- Date --> */}
          <div class="des-from">
            <p>Journey Date</p>
            <input
              type="date"
              class="outline-none px-2 py-2 w-full date"
              name="date"
              id="lws-date"
              required
              onChange={(e) => dateSelector(e.target.value)}
            />
          </div>

          {/* <!-- Guests --> */}
          <div class="des-from">
            <p>Guests</p>
            <div class="flex flex-row">
              <img src="./img/icons/Vector (1).svg" alt="" />
              <select
                class="outline-none px-2 py-2 w-full"
                name="guests"
                id="lws-guests"
                required
                onChange={(e) => guestsSelector(e.target.value)}
              >
                <option value="" hidden>
                  Please Select
                </option>
                <option value="1">1 Person</option>
                <option value="2">2 Persons</option>
                <option value="3">3 Persons</option>
                <option value="4">4 Persons</option>
              </select>
            </div>
          </div>

          {/* <!-- Class --> */}
          <div class="des-from !border-r-0">
            <p>Class</p>
            <div class="flex flex-row">
              <img src="./img/icons/Vector (3).svg" alt="" />
              <select
                class="outline-none px-2 py-2 w-full"
                name="ticketClass"
                id="lws-ticketClass"
                required
                onChange={(e) => classSelector(e.target.value)}
              >
                <option value="" hidden>
                  Please Select
                </option>
                <option>Business</option>
                <option>Economy</option>
              </select>
            </div>
          </div>

          <button class="addCity" type="submit" id="lws-addCity">
            <svg
              width="15px"
              height="15px"
              fill="none"
              viewBox="0 0 24 24"
              stroke-width="2"
              stroke="currentColor"
            >
              <path
                stroke-linecap="round"
                stroke-linejoin="round"
                d="M12 4.5v15m7.5-7.5h-15"
              />
            </svg>
            <span class="text-sm">Book</span>
          </button>
        </form>
      </div>
    </div>
  );
};

export default InputData;
